import React, { useState } from "react";
import {
  Typography,
  TextField,
  Button,
  Stepper,
  Step,
  StepLabel,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import {
  Modal,

  Form,
  Col,
  Row,
  Container,
  FormGroup,
} from "react-bootstrap";
const useStyles = makeStyles((theme) => ({
  button: {
    marginRight: theme.spacing(1),
  },
}));

function getSteps() {
  return [
    "Personal Information",
    "Address & Region",
    "Education Information",
    "Previous Information",
    "Employement Details",
    "Bank Details"
  ];
}

function getStepContent(step) {
  switch (step) {
    case 0:
      return (
        <>
          
          <div className="w-75" id="responsivewidth">
                  <Col>
                    <Row >
                      <Col xxl="6" xl="6" lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridFirstName"
                          className="formmargin"
                        >
                          <Form.Label>First Name</Form.Label>
                          <Form.Control
                            type="text"
                            required
                            name="firstname"
                            placeholder="First Name"
                            // value={emp.firstname}
                            // onChange={handleinput}
                          />
                        </Form.Group>
                      </Col>
                      <Col xxl="6" xl="6" lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>Last Name</Form.Label>
                          <Form.Control
                            type="text"
                            required
                            name="lastname"
                            placeholder="Last Name"
                            // value={emp.lastname}
                            // onChange={handleinput}
                          />
                        </Form.Group>
                      </Col>
                    </Row>
                    <Row>
                      <Col xxl='6' xl='6' lg='6' md='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridgender"
                          className="formmargin"
                        >
                          <Form.Label>Gender</Form.Label>
                          <Form.Select
                            required
                            name="gender"
                            // value={emp.gender}
                            // onChange={handleinput}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Male</option>
                            <option>Female</option>
                            <option>Other</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                      <Col xl='6' lg="6" md="6">
                        <Form.Group
                          as={Col}
                          controlId="formGridFirstName"
                          className="formmargin"
                        >
                          <Form.Label>National ID </Form.Label>
                          <Form.Control
                            type="number"
                            required
                            name="cnic"
                            placeholder="CNIC"
                            // value={emp.cnic}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          />
                        </Form.Group>
                      </Col>
                    </Row>
                    <Row>
                      <Col xxl='6' xl='6' lg='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>D-0-B</Form.Label>
                          {/* <DatePicker
                            required
                            selected={emp.dob}
                            onChange={(date)=>{setEmp({...emp,dob:moment(date).format('dd/mm/yyyy')})}}
                            // dateFormat='d MMMM, yyyy'
                            dateFormat='dd/mm/yyyy'
                            dropDownMode="select"
                          /> */}
                          <Form.Control
                            type="date"
                            required
                            placeholder="dd/mm/yyyy"
                            name="dob"
                            // value={emp.dob}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          />
                        </Form.Group>
                      </Col>

                      <Col  xl='6' lg="6" >
                        <Form.Group
                          as={Col}
                          controlId="formGridMartialStatus"
                          className="formmargin"
                        >
                          <Form.Label>Martial Status</Form.Label>
                          <Form.Select
                            required
                            name="martialStatus"
                            placeholder="martial status.."
                            // value={emp.martialStatus}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Single</option>
                            <option>Married</option>
                            <option>Divorced</option>
                            <option>widow</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                      <Col xl='6' lg='6'>
                        <Form.Group
                          as={Col}
                          controlId="formGridLastName"
                          className="formmargin"
                        >
                          <Form.Label>Religion</Form.Label>
                          <Form.Select
                            required
                            name="religion"
                            placeholder="Religion"
                            // value={emp.religion}
                            // onChange={handleinput}
                            //   disabled={disableFields}
                          >
                            <option value="" selected hidden disabled>
                              Please Select
                            </option>
                            <option>Islam</option>
                            <option>Christianity</option>
                            <option>Buddhism</option>
                            <option> Sikhism</option>
                            <option> Hinduism</option>
                            <option>Bahá’í</option>
                            <option>Confucianism</option>
                            <option>Jainism</option>
                            <option>Judaism</option>
                            <option>Zoroastrianism</option>
                            <option>Druze</option>
                          </Form.Select>
                        </Form.Group>
                      </Col>
                    </Row>
                  </Col>
                  
                  </div>
                  
        </>
      );

    case 1:
      return (
        <>
         
            <div>
          <Row>
                    <h5
                      className="py-2 "
                      style={{ fontSize: "22px", padding: "0px 19px" }}
                    >
                      Primary
                    </h5>
           <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridphone"
                        className="formmargin "
                      >
                        <Form.Label>Phone</Form.Label>
                        <Form.Control
                          type="number"
                          required
                          name="primaryphone"
                          placeholder="phone"
                          // value={emp.primaryphone}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Email</Form.Label>
                        <Form.Control
                          type="email"
                          required
                          name="primaryemail"
                          placeholder="email"
                          // value={emp.primaryemail}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                  </Row>

                  <Row>
                    <h5
                      className="py-2 "
                      style={{ fontSize: "22px", padding: "0px 19px" }}
                    >
                      Secondary
                    </h5>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Phone</Form.Label>
                        <Form.Control
                          type="number"
                          required
                          name="secondaryphone"
                          placeholder="secondary phone"
                          // value={emp.secondaryphone}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                    <Col xxl="6" xl="6" lg="6" md="6">
                      <Form.Group
                        as={Col}
                        controlId="formGridcompanyemail"
                        className="formmargin "
                      >
                        <Form.Label>Email</Form.Label>
                        <Form.Control
                          type="email"
                          required
                          name="secondaryemail"
                          placeholder="secondary Email"
                          // value={emp.secondaryemail}
                          // onChange={handleinput}
                        />
                      </Form.Group>
                    </Col>
                    </Row>
                    </div>
        </>
      );
    case 2:
      return (
        <>
         <div>
            <Col lg={12}>
                  <Form.Group
                    as={Col}
                    controlId="formGridFirstName"
                    className="formmargin"
                  >
                    <Form.Label>Temporary Address</Form.Label>
                    <Form.Control
                      type="text"
                      required
                      name="temporaryaddress"
                      placeholder="complete address"
                      // value={emp.temporaryaddress}
                      // onChange={handleinput}
                      //   disabled={disableFields}
                    />
                  </Form.Group>
                </Col>

                <Col lg={12}>
                  <Form.Group
                    as={Col}
                    controlId="formGridFirstName"
                    className="formmargin"
                  >
                    <Form.Label>Permanent Address</Form.Label>
                    <Form.Control
                      type="text"
                      required
                      name="permanentaddress"
                      placeholder="complete address"
                      // value={emp.permanentaddress}
                      // onChange={handleinput}
                      //   disabled={disableFields}
                    />
                  </Form.Group>
                </Col>
                {/* </Row> */}
                <div style={{marginLeft:'0.75%'}}>
                <Row>
                  <Col>
                    <Form.Label style={{marginLeft:'2%'}}>City</Form.Label>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Select
                        required
                        // onChange={handleinput}
                        name="city"
                        // value={emp.city}
                      >
                        <option value="" selected hidden disabled>
                          Select City
                        </option>
                        {/* {cities.map((d, i) => {
                          return <option key={i}>{d}</option>;
                        })} */}
                      </Form.Select>
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Label>Province</Form.Label>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Select
                        required
                        name="province"
                        placeholder="province"
                        // value={emp.province}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      >
                        <option value="" selected hidden disabled>
                          Select Province
                        </option>
                        <option>Punjab</option>
                        <option>Sindh</option>
                        <option>KPK</option>
                        <option>Gilgit Baltistan</option>
                        <option>Islamabad(Capital Territory)</option>
                      </Form.Select>
                    </Form.Group>
                  </Col>
                  <Col>
                    <Form.Label>Country</Form.Label>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      {/* <ReactFlags
                        countries={["PK"]}
                        selected={selected}
                        onSelect={(code) => {
                          setSelected(code);
                          code === "PK" && setcountry("Pakistan");
                          setEmp({...emp,country:"Pakistan"})
                        }}
                      /> */}
                    </Form.Group>
                  </Col>
                </Row>
                <Row>
                  <Col lg={4} xl={4}>
                    <Form.Group
                      as={Col}
                      controlId="formGridLastName"
                      className="formmargin"
                    >
                      <Form.Label>Postal Code</Form.Label>
                      <Form.Control
                        type="text"
                        required
                        name="postalCode"
                        placeholder="postal code"
                        // value={emp.postalCode}
                        // onChange={handleinput}
                        //   disabled={disableFields}
                      />
                    </Form.Group>
                  </Col>
                </Row>
                </div>
                </div>
        </>
      );
    case 3:
      return (
        <>
          {/* <TextField
            id="cardNumber"
            label="Card Number"
            variant="outlined"
            placeholder="Enter Your Card Number"
            fullWidth
            margin="normal"
            name="cardNumber"
          />
          <TextField
            id="cardMonth"
            label="Card Month"
            variant="outlined"
            placeholder="Enter Your Card Month"
            fullWidth
            margin="normal"
            name="cardMonth"
          />
          <TextField
            id="cardYear"
            label="Card Year"
            variant="outlined"
            placeholder="Enter Your Card Year"
            fullWidth
            margin="normal"
            name="cardYear"
          /> */}
          <Modal
          aria-labelledby="contained-modal-title-vcenter"
          centered
          show={childModel1}
          onHide={Closechildmodal1}
          size="lg"
        >
          <Modal.Header closeButton>
            <Modal.Title
              id="contained-modal-title-vcenter "
              style={{ textAlign: "center" }}
            >
              <h5>Education Details</h5>
            </Modal.Title>
          </Modal.Header>
          <Modal.Body>
            <Container fluid>
              <Row className="mb-3">
                {/* <div className="py-3">
                    <h4>Education Information</h4>
                    <hr
                      style={{
                        fontWeight: "bold",
                        borderWidth: "2px",
                        border: "1px solid black",
                      }}
                    ></hr>
                  </div> */}

                <Col>
                  <Form.Group
                    as={Col}
                    controlId="formGridLastName"
                    className="formmargin"
                  >
                    <Form.Label>Institution</Form.Label>
                    <Form.Control
                      type="text"
                      required
                      name="institute"
                      placeholder="institution.."
                      value={details.institute}
                      onChange={handleeducationdetails}
                        // disabled={disableFields}
                    />
                  </Form.Group>
                </Col>
                <Col>
                  <Form.Group
                    as={Col}
                    controlId="formGridLastName"
                    className="formmargin"
                  >
                    <Form.Label>Degree Title</Form.Label>
                    <Form.Control
                      type="text"
                      required
                      name="degreetitle"
                      placeholder="degree.."
                      value={details.degreetitle}
                      onChange={handleeducationdetails}
                        // disabled={disableFields}
                    />
                  </Form.Group>
                </Col>
              </Row>
              <Row>
                <Col>
                  <Form.Group
                    as={Col}
                    controlId="formGridLastName"
                    className="formmargin"
                  >
                    <Form.Label>Start</Form.Label>
                    <Form.Control
                      type="date"
                      required
                      name="start"
                      value={details.start}
                      onChange={handleeducationdetails}
                        // disabled={disableFields}
                    />
                  </Form.Group>
                </Col>
                <Col>
                  <Form.Group
                    as={Col}
                    controlId="formGridLastName"
                    className="formmargin"
                  >
                    <Form.Label>End</Form.Label>
                    <Form.Control
                      type="date"
                      required
                      name="end"
                      value={details.end}
                      onChange={handleeducationdetails}
                        // disabled={disableFields}
                    />
                  </Form.Group>
                </Col>
                <Col>
                  <Form.Group
                    as={Col}
                    controlId="formGridLastName"
                    className="formmargin"
                  >
                    <Form.Label>Status</Form.Label>
                    <Form.Select
                      required
                      name="status"
                      placeholder="status"
                      value={details.status}
                      onChange={handleeducationdetails}
